import React from 'react';

function Compte(props){
	const compte_json = 
		{
			prenom:"Nasser",
            nom:"Nourou",
            displayName:"Nasser Nourou",
			dateCreation:"le 3 janvier 2022",
			points:2352,
			status:"Morphologie de type B majuscule",
			resaux:[
				{
					nom:"Instagram",
					url:"200 €"
				},
				{
					nom:"Tweeter",
					url:"Boutique physique et en ligne"
				},
				{
					nom:"Snapchat",
					url:"Soumettre sa tenu avant la date de fin"
				},
				{
					nom:"TikTok",
					url:"Soumettre sa tenu avant la date de fin"
				},

			],
            proprietaire:true,
		}

	const compte = compte_json.map((c) =>
		<div className='w-100'>
			{
				(d.proprietaire===true) ?
                <div className="compte">
                    <img src="" alt="" className="comptePhoto" />
                    <h4 className="compteName"></h4>
                    <h6 className="compteUsername"></h6>
                    <span className="comptePoint"></span>
                    <p className="compteStatut"></p>
                    <ul className="compteReseaux">
                        {c.reseaux.map(r => 
                        <li className="compteLink">
                            <a href="" className="w-100">
                                <span>{r.nom} :</span>
                                <span className='fw-bold'> {r.valeur}</span>
                            </a>
                        </li>	
                        )}
                    </ul>

                </div>
				:
				<div className="defi fini">
					<h4 className="defiDate">
						Défi de la semaine du {d.semaine}	
					</h4>				
					<h3 className="defiName">
						{d.titre}
					</h3>
					<div className="d-flex align-items-center">
						<button className="defiBtn">Voir le Showroom</button>
						<p className="defiParticipant">
							{d.participantNb} ont participé à ce défi
						</p>
					</div>
				</div>
			}
		</div>
	)

    return (
		<div className=" d-flex justify-content-center align-items-center ">
			{compte}
		</div>  
    );
}
export default Compte;
